import React from "react";
import { Link } from "react-router-dom";
import { Card } from "react-bootstrap";

const Desktops = (props) => {
  return (
    <>
      {props.desktops.map((desktops, id) => (
        <Link to={`/blogs/${desktops.id}`} className="links">
          <div key={id}>
            <Card
              style={{ width: "13.8rem", border: `none`, marginBottom: `10px` }}
              className="card"
            >
              <Card.Img variant="top" src={props.desktops.imgUrl} />
              <Card.Body>
                <Card.Title> {props.desktops.name}</Card.Title>
                <Card.Text>
                  <p>{props.desktops.price}</p>
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
        </Link>
      ))}
    </>
  );
};

export default Desktops;
